ZDiyCurves.generateShapes = function (dataString, scale, offset_x, offset_y) {
    if (scale === undefined) scale = 1;
    if (offset_x === undefined) offset_x = 0;
    if (offset_y === undefined) offset_y = 0;

    var path = new THREE.Path(); 
    var pts = [];

    var i, i2, divisions,
        outline, action, length,
        scaleX, scaleY,
        x, y, cpx, cpy, cpx0, cpy0, cpx1, cpy1, cpx2, cpy2,
        laste;

    if ( dataString ) {

        outline = dataString.split(' ');
        length = outline.length;

        scaleX = scale;
        scaleY = scale;

        for ( i = 0; i < length; ) {

            action = outline[ i ++ ];

            //console.log( action );

            switch ( action ) {

            case 'm':

                // Move To

                x = outline[ i ++ ] * scaleX + offset_x;
                y = outline[ i ++ ] * scaleY + offset_y;

                path.moveTo( x, y );
                break;

            case 'l':

                // Line To

                x = outline[ i ++ ] * scaleX + offset_x;
                y = outline[ i ++ ] * scaleY + offset_y;
                path.lineTo( x,y );
                break;

            case 'q':

                // QuadraticCurveTo

                cpx  = outline[ i ++ ] * scaleX + offset_x;
                cpy  = outline[ i ++ ] * scaleY + offset_y;
                cpx1 = outline[ i ++ ] * scaleX + offset_x;
                cpy1 = outline[ i ++ ] * scaleY + offset_y;

                path.quadraticCurveTo( cpx1, cpy1, cpx, cpy );

                laste = pts[ pts.length - 1 ];

                if ( laste ) {

                    cpx0 = laste.x;
                    cpy0 = laste.y;

                    for ( i2 = 1, divisions = this.divisions; i2 <= divisions; i2 ++ ) {

                        var t = i2 / divisions;
                        var tx = THREE.Shape.Utils.b2( t, cpx0, cpx1, cpx );
                        var ty = THREE.Shape.Utils.b2( t, cpy0, cpy1, cpy );
                  }

              }

              break;

            case 'b':

                // Cubic Bezier Curve
                cpx1 = outline[ i ++ ] *  scaleX + offset_x;
                cpy1 = outline[ i ++ ] *  scaleY + offset_y;
                cpx2 = outline[ i ++ ] *  scaleX + offset_x;
                cpy2 = outline[ i ++ ] *  scaleY + offset_y;
                cpx  = outline[ i ++ ] *  scaleX + offset_x;
                cpy  = outline[ i ++ ] *  scaleY + offset_y;

                path.bezierCurveTo( cpx1, cpy1, cpx2, cpy2, cpx, cpy );

                laste = pts[ pts.length - 1 ];

                if ( laste ) {

                    cpx0 = laste.x;
                    cpy0 = laste.y;

                    for ( i2 = 1, divisions = this.divisions; i2 <= divisions; i2 ++ ) {

                        var t = i2 / divisions;
                        var tx = THREE.Shape.Utils.b3( t, cpx0, cpx1, cpx2, cpx );
                        var ty = THREE.Shape.Utils.b3( t, cpy0, cpy1, cpy2, cpy );

                    }

                }

                break;

            }

        }
    }

    var shapes = path.toShapes();

    return shapes;
};